import React from 'react';
import CustomNavbar from '../components/Navbar';

function Profile() {
  return (
    <>
      <CustomNavbar />
      <div className="profile-content">
        <h2>Your Profile</h2>
        <p>Manage your account information here.</p>
      </div>
    </>
  );
}

export default Profile;
